import React from "react";
import Movieslist from "./components/Movieslist";
import 'bootstrap/dist/css/bootstrap.min.css';
import { Button } from "react-bootstrap";
function App() {
  return (
    <div className="App">
      
      <Button >Button</Button>
      <Movieslist /> 
    </div>
  );
}
export default App;
